    return (
        <>
           <Hero title = "Reactjs by Waleoxy" max="true" img = {mainBcg}>
            <Link className="linktext" to="/works"
             style={{margin: "2rem"}}> my works 
            </Link>
           </Hero>
        </>
    )
}
